import { Form, ListGroup, } from "react-bootstrap";

export default function Todo({ todo: { id, name, checked }, checkTodo }) {

  function handleCheck() {
    checkTodo(id)
  }

  return (
    <ListGroup.Item className="todo-item" variant={ checked ? "success" : "secondary" } >
      <Form.Check.Input className="checkbox" onChange={handleCheck} />
      {name}
    </ListGroup.Item>
  )
}
